// Header.js
import React from 'react';

function Header() {
  return (
    <header>
      <h1>Hello, I'm Arunit Baidya</h1>
      <p>Aspiring Backend Software Engineer</p>
      <p>Looking for Internships in Summer 2025 & Fall 2025</p>
      <p>Graduating from MS CS program in Spring 2026</p>
      <a href="/Arunit%20Baidya%20-%20Software%20Engineer%20Resume.pdf" className="download">
        View my Resume
      </a>
    </header>
  );
}

export default Header;
